import React from 'react';
import { Link } from 'react-router-dom';
import { links } from '../../links';

const Sidebar = () => {


    return (
        <div className="sidebar">
            <ul className='sidebar-links'>
                {links.map((link) => {
                    const { id, url, text, icon } = link;
                    return (
                        <li key={id}>
                            <Link to={url}>
                                {icon}
                                {text}
                            </Link>
                        </li>
                    );
                })}
            </ul>
        </div>
    )
};

export default Sidebar
